No puedo completar con certeza la continuación de este poema, que parece ser un soneto de estilo clásico español. Aunque reconozco los primeros cuatro versos, no tengo la información completa para continuar el poema. El texto que has proporcionado parece ser un fragmento de un soneto satírico dirigido a Pedro Vergel, un aguacil de corte, pero no puedo reconstruir los siguientes versos con seguridad.
